(window.webpackJsonp=window.webpackJsonp||[]).push([[101],{321:function(e){e.exports={data:{posts:{totalCount:84,pageInfo:{totalPages:5,currentPage:2,isFirst:!1,isLast:!1},edges:[{node:{title:"Human life is better now than it ever has been",path:"/blog/2017/12/20/human-life-is-better-now-than-it-ever-has-been",excerpt:"<p>A common claim made by some religious doctrines is that the world is in an awful state, and that humanity is deteriorating. In many Christian denominations this is based on so called prophecies that are claimed to have been made thousands of years ago. It is generally stated that mankind, growing distant from their deity, would just hit the fan.</p>\n",date:"2017-12-20T00:00:00.000Z",timeToRead:4}},{node:{title:"We Evolved",path:"/blog/2017/11/23/we-evolved",excerpt:"<p>As I wrote here a long time ago, I used to be associated with a rather well known and widespread religion – The Jehovah’s Witnesses.</p>\n",date:"2017-11-23T00:00:00.000Z",timeToRead:4}},{node:{title:"Me and Mr Carl",path:"/blog/2017/11/18/me-and-mr-carl",excerpt:"<p>So, I had a fun night.</p>\n",date:"2017-11-18T00:00:00.000Z",timeToRead:2}},{node:{title:"Life is Strange",path:"/blog/2017/10/21/life-is-strange",excerpt:"<p>Part of the motivation behind leaving my life in the city was the lack of employment, but the main factor was that of family.</p>\n",date:"2017-10-21T00:00:00.000Z",timeToRead:2}},{node:{title:"Insane",path:"/blog/2017/10/06/insane",excerpt:"<p>Did I ever tell you what the definition of insanity is? Insanity is doing the exact... same thing... over and over again and… expecting a different outcome.</p>\n",date:"2017-10-06T00:00:00.000Z",timeToRead:2}},{node:{title:"Absolution",path:"/blog/2017/09/18/absolution",excerpt:"<p>Train? Bus? Nope. In the party wagon with this guy.</p>\n",date:"2017-09-18T00:00:00.000Z",timeToRead:1}},{node:{title:"Can't hold on much longer",path:"/blog/2017/09/18/can-t-hold-on-much-longer",excerpt:"<p>This stinks.</p>\n",date:"2017-09-18T00:00:00.000Z",timeToRead:2}},{node:{title:"A Nation of Stags",path:"/blog/2017/09/08/a-nation-of-stags",excerpt:"<p>And here we go again.</p>\n",date:"2017-09-08T00:00:00.000Z",timeToRead:3}},{node:{title:"Life with a Chuwi (Lapbook 12.3)",path:"/blog/2017/09/03/life-with-a-chuwi-lapbook-12-3",excerpt:"<p>I’m back on the bus! But this time I am going to strive to do something productive on the journey.</p>\n",date:"2017-09-03T00:00:00.000Z",timeToRead:5}},{node:{title:"At Dawn",path:"/blog/2017/08/25/at-dawn",excerpt:"<p>Who knew it was this cold at 5:30 am?</p>\n",date:"2017-08-25T00:00:00.000Z",timeToRead:2}},{node:{title:"Current (life) events",path:"/blog/2017/08/17/current-life-events",excerpt:"<p>Well, stuff is happening.</p>\n",date:"2017-08-17T00:00:00.000Z",timeToRead:1}},{node:{title:"Living in the City (you know you have to survive)",path:"/blog/2017/08/14/living-in-the-city-you-know-you-have-to-survive",excerpt:"<p>Well, my life has changed.</p>\n",date:"2017-08-14T00:00:00.000Z",timeToRead:2}},{node:{title:"New Zealand Politics 2017",path:"/blog/2017/08/02/new-zealand-politics-2017",excerpt:"<p>New Zealand doesn’t have a political system like the United States. The head of the country isn’t someone you vote for directly. Instead you vote for a political party, and the head of a particular party then becomes the countries leader – or Prime Minister.</p>\n",date:"2017-08-02T00:00:00.000Z",timeToRead:5}},{node:{title:"The Nuclear Option",path:"/blog/2017/07/27/the-nuclear-option",excerpt:"<p>Nuclear power has always been very controversial, but since the disaster in Japan at the Fukushima Daiichi power plant the topic has come under more scrutiny than ever.</p>\n",date:"2017-07-27T00:00:00.000Z",timeToRead:5}},{node:{title:"When Nice Stuff Happens",path:"/blog/2017/07/15/when-nice-stuff-happens",excerpt:"<p>Doesn’t stuff happen? Nice stuff happens. I like it when nice stuff happens.</p>\n",date:"2017-07-15T00:00:00.000Z",timeToRead:2}},{node:{title:"Query the theoretical",path:"/blog/2017/07/11/query-the-theoretical",excerpt:"<p>This will be a bit of thinking out loud, a stream of consciousness. It won’t have the editorial quality that I’m trying to follow, but some strange force is motivating me to put this out before I sleep. It’s just turned 1 am.</p>\n",date:"2017-07-11T00:00:00.000Z",timeToRead:3}},{node:{title:"Oh What a Night?",path:"/blog/2017/06/30/oh-what-a-night",excerpt:"<p>This is the finish my friend, this is the End.</p>\n",date:"2017-06-30T00:00:00.000Z",timeToRead:1}},{node:{title:"It's Business Time",path:"/blog/2017/06/25/it-s-business-time",excerpt:"<p>In my great effort to move forward and get down to business, I got business cards printed.</p>\n",date:"2017-06-25T00:00:00.000Z",timeToRead:1}},{node:{title:"Research report into Name of Austin",path:"/blog/2017/06/21/research-report-into-name-of-austin",excerpt:'<h3 id="what-is-austin"><a href="#what-is-austin" aria-hidden="true"><span class="icon icon-link"></span></a>What is Austin?</h3>\n',date:"2017-06-21T00:00:00.000Z",timeToRead:3}},{node:{title:"I have, I want",path:"/blog/2017/06/16/i-have-i-want",excerpt:"<p>First, I built a splash page profile to help expand my reach as I go into this new world of freelance, casual employment.</p>\n",date:"2017-06-16T00:00:00.000Z",timeToRead:2}}]}}}}}]);